import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Black Knight Financial Services</h1>
        <nav>
          <ul>
            <li>Extraction</li>
            <li>Classification</li>
          </ul>
        </nav>
      </header>
    </div>
  );
}

export default App;
